        {/* upwork */}
        <a className="home-social-link" href='#.' target='_blank'>
            <i className=''></i>
        </a>
        {/* github */}
        <a className="home-social-link" href='#.' target='_blank'>
            <i className=''></i>
        </a>
    </div>
  )
}

export default Socials
